        function getEqnList() {

          str += "<table width='90%' align='center' border='1' cellpadding='0' cellspacing='0'>";

            str += "</td></tr>";
          }
          for (s=0; s<signals.length; s++) {
            str += "<tr><td>";

            str += "</td></tr>";
